import React from "react";
import './register.css';
import { Link } from 'react-router-dom';

const Register = () => {
    return (

        <div className="register">
            <div className="register-wrapper">
                <div className="register-left">
                    <h3 className="register-logo">DonDokas</h3>
                    <span className="register-desc">
                        Connect with friends and the world around you on DonDokas.
                    </span>
                </div>
                <div className="register-right">
                    <div className="register-box">
                        <input placeholder="Username" className="register-input" />
                        <input placeholder="Email" className="register-input" />
                        <input placeholder="Password" className="register-input" />
                        <input placeholder="Confirm Password" className="register-input" />
                        <button className="register-button">Sign Up</button>
                    </div>
                </div>
                {/* Se já estiver cadastrado redirecionar para login com um botão */}
                <Link to="/login" className="register-login-link">
                    <button className="register-login-button">Log into Account</button>
                </Link>
            </div>
        </div>
        

    );
};

export default Register;
